package com.stylefeng.guns.modular.dist.vo;

public class TradeAmountVo {

    private  String userId;

    private String userName;

    private String type;

    private String disPlatformId;

    private String superAccount;

    private String typeName;

    private String typeAmount;

    public String getUserId() {
        return userId;
    }

    public void setUserId(String userId) {
        this.userId = userId;
    }

    public String getUserName() {
        return userName;
    }

    public void setUserName(String userName) {
        this.userName = userName;
    }

    public String getType() {
        return type;
    }

    public void setType(String type) {
        this.type = type;
    }

    public String getDisPlatformId() {
        return disPlatformId;
    }

    public void setDisPlatformId(String disPlatformId) {
        this.disPlatformId = disPlatformId;
    }

    public String getSuperAccount() {
        return superAccount;
    }

    public void setSuperAccount(String superAccount) {
        this.superAccount = superAccount;
    }

    public String getTypeName() {
        return typeName;
    }

    public void setTypeName(String typeName) {
        this.typeName = typeName;
    }

    public String getTypeAmount() {
        return typeAmount;
    }

    public void setTypeAmount(String typeAmount) {
        this.typeAmount = typeAmount;
    }
}
